class Convert{static string(t){return""+t}static int(t){return t+0}static bool(t){return 0===t}}class Console{static write(t){console.log(t)}}class math{static pow(t,r){var s,a=1;for(s=0;s<r;s++)a*=t;return a}static sqrt(t){var r,s=t/2;do{s=((r=s)+t/r)/2}while(r!==s);return r}static floor(t){return Math.floor(t)}static ceil(t){return Math.ceil(t)}static round(t){return Math.round(t)}}class json{static decode(t){return JSON.parse(t)}static encode(t){return JSON.stringify(t)}}